use practice;
create table IF NOT EXISTS practice.Car_info (
	`id` INT,
	`car_name` VARCHAR(50),
	`car_maker` VARCHAR(50),
	`car_model_year` varchar(10),
	`car_price` int
);


create table cars as (select id,car_name,car_maker,car_model_year,round(car_price,-1) as car_price
from car_info);

use practice;


-- 삭제후에 auto_increment 값 초기화 하는 방법
alter table cars auto_increment=1;
set @count = 0;
update cars set id = @count:=@count+1;


select * from cars order by id desc;
show table status where name='cars';

alter table cars modify column id int primary key auto_increment;

delete from cars where id=1000;